import { useNavigate } from "react-router-dom";

const AdminDashboard = () => {
  const navigate = useNavigate();

  return (
    <div className="dashboard">
      <div className="sidebar">
        <h3>Admin Panel</h3>

        <button onClick={() => navigate("/admin/edit-posts")}>
          Edit Posts
        </button>

        <button onClick={() => navigate("/admin/edit-team")}>
          Edit Team
        </button>

        <button onClick={() => navigate("/admin/edit-content")}>
          Edit Content
        </button>

        <button onClick={() => {
          localStorage.removeItem("adminAuth");
          navigate("/");
        }}>
          Logout
        </button>
      </div>

      <div className="main">
        <h2>Select what you want to edit</h2>
      </div>
    </div>
  );
};

export default AdminDashboard;
